 * See org.keycloak.authentication.authenticators.browser.ScriptBasedAuthenticatorFactory
 */

// import enum for error lookup
AuthenticationFlowError = Java.type("org.keycloak.authentication.AuthenticationFlowError");

/**
 * An example authenticate function.
 *
 * The following variables are available for convenience:
 * user - current user {@see org.keycloak.models.UserModel}
 * realm - current realm {@see org.keycloak.models.RealmModel}
 * session - current KeycloakSession {@see org.keycloak.models.KeycloakSession}
 * httpRequest - current HttpRequest {@see org.jboss.resteasy.spi.HttpRequest}
 * script - current script {@see org.keycloak.models.ScriptModel}
 * authenticationSession - current authentication session {@see org.keycloak.sessions.AuthenticationSessionModel}
 * LOG - current logger {@see org.jboss.logging.Logger}
 *
 * You one can extract current http request headers via:
 * httpRequest.getHttpHeaders().getHeaderString("Forwarded")
 *
 * @param context {@see org.keycloak.authentication.AuthenticationFlowContext}
 */
function authenticate(context) {

    var username = user ? user.username : "anonymous";
    LOG.info(script.name + " trace auth for: " + username);

    var cloudClientIds = ["app-frontend-plainjs"];

    var currentClient = authenticationSession.getClient();
    var isRestrictedClient = cloudClientIds.indexOf(currentClient.clientId) >= 0;

    if (!isRestrictedClient) {
        // allow access to unrestricted client
        LOG.info("login success for " + username);
        context.success();
        return;
    }

    // perform additional checks for access to restricted client
    var cloudRole = realm.getRole("tester");
    var authShouldSuccess = user.hasRole(cloudRole);
    if (authShouldSuccess) {
        LOG.info("login success for " + username);
        context.success();
    } else {
        LOG.info(script.name + " access denied for restricted cloud client: username: " + username + " clientId: " + currentClient.clientId);
        context.failure(AuthenticationFlowError.INVALID_USER);
    }
}

